def maxVowels(s, k):
    vowels = ["a","e","i","o","u"]
    maxx = 0
    final = 0
    for i in range(s[0:k]):
        if i in vowels:
            maxx += 1
    for i in range(k, len(s)):
        if s[i] in vowels:
            maxx += 1
        if s[i-k] in vowels:
            maxx -= 1
        final = max(final, maxx)
    return final





print(maxVowels('', 3945))